class Calls {
    constructor(number) {
        this.url = 'numbersapi.com/';
        this.number = number;
    }

    getResult() {
        fetch(this.url + this.number)
            .then(res => res.json())
            .then((res) => {
                console.log(res);
            }, (err) => {
                console.log(err);
            })
    }
}

export default new Calls;
